import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
import logo from '../img/logo.png';

const Header = () => {
    return (
        <header className="header">
            <div className="logo-container">
                <img src={logo} alt="Логотип" className="logo" />
                <h1>dont be a MONKEY</h1>
            </div>
            <nav className="nav">
                <ul className="nav-list">
                    <li><Link to="/"><button>Главная</button></Link></li>
                    <li><Link to="/course"><button>Курсы</button></Link></li>
                    <li><button>Трудоустройство</button></li>
                    <li><Link to="/contacts"><button>Контакты</button></Link></li>
                    <li><button>Авторизация</button></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
